import { useCallback } from "react";
import { TextField, Button } from "@mui/material";
import { useNavigate } from "react-router-dom";
import MyComponent from "./MyComponents";
import { Link } from "react-router-dom";
const Desktop14 = ({ formData, setFormData }) => {
  const navigate = useNavigate();

  return (
    <div className="desktop-9-resp">
      <div className="bg-tomato h-[150px]">
        <Button
          className="cursor-pointer"
          sx={{ width: 330 }}
          variant="contained"
          color="primary"
          href="/"
        >{`<- Go Back`}</Button>
      </div>
      {/* <TextField
        className="[border:none] absolute top-[75px] left-[967px]"
        sx={{ width: 431 }}
        color="error"
        variant="filled"
        type="text"
        id="search"
        placeholder="Search"
        size="medium"
        margin="none"
      /> */}

      <div>
        <MyComponent formData={formData} setFormData={setFormData} />
      </div>
    </div>
  );
};

export default Desktop14;
